import React from "react";
import "./styles.css";

// IMAGENS
import deskmob from "../../Images/Home/Section-1/desktop-and-mobile.png";



function Home() {
    return (
        <>
            <section className="home_section1">
                <div>
                    <img src={deskmob} />
                </div>
            </section>
        </>
    )
}

export default Home
